db.payers.aggregate([
    {
        $match: {
            "NAME": "Humana"
        }
    },
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $group: {
            _id: {
                DIAGNOSIS_1: "$CLAIMS.CLAIM_TRANSACTIONS.DIAGNOSIS_REF_1"
            },
            COVERAGE: {
                $push: "$CLAIMS.CLAIM_TRANSACTIONS.AMOUNT"
            },
            CODE: {
                $push: "$CLAIMS.CLAIM_TRANSACTIONS.PROCEDURE_CODE"
            }
        }
    },
    {
        $unwind: "$COVERAGE"
    },
    {
        $unwind: "$CODE"
    },
    {
        $project: {
            _id: 0,
            DIAGNOSIS_1: "$_id.DIAGNOSIS_1",
            AMOUNT: "$COVERAGE",
            CODE: "$CODE"
        }
    },
    {
        $lookup: {
            from: "procedures",
            localField: "CODE",
            foreignField: "CODE",
            as: "PROCEDURE_INFO"
        }
    },
    {
        $unwind: "$PROCEDURE_INFO"
    },
    {
        $match: {
            "PROCEDURE_INFO.BASE_COST": {
                $gt: "0"
            }
        }
    },
    {
        $project: {
            _id: 0,
            DIAGNOSIS_1: 1,
            AMOUNT: 1,
            COST: "$PROCEDURE_INFO.BASE_COST"
        }
    },
    {
        $group: {
            _id: "Immunizations",
            UNCOVERED: {
                $push: {
                    AMOUNT: "$AMOUNT",
                    COST: "$COST"
                }
            }
        }
    },
    {
        $unwind: "$UNCOVERED"
    },
    {
        $project: {
            _id: 0,
            AMOUNT: "$UNCOVERED.AMOUNT",
            COST: "$UNCOVERED.COST"
        }
    },
    {
        $group: {
            _id: null,
            TOTAL_UNCOVERED: {
                $sum: "$AMOUNT"
            },
            TOTAL_COST: {
                $sum: "$COST"
            }
        }
    },
    {
        $project: {
            _id: 0,
            TOTAL_UNCOVERED: 1,
            TOTAL_COST: 1
        }
    }
])

