db.patients.aggregate([
  {
    $unwind: "$CLAIMS"
  },
  {
    $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
  },
  {
    $lookup: {
      from: "payers",
      localField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
      foreignField: "PAYER_ID",
      as: "payerInfo"
    }
  },
  {
    $unwind: "$payerInfo"
  },
  {
    $match: {
      "payerInfo.NAME": "Aetna"
    }
  },
  {
    $group: {
      _id: "$payerInfo.NAME",
      num_procedures: {
        $sum: {
          $cond: {
            if: {
              $ne: ["$CLAIMS.CLAIM_TRANSACTIONS.PROCEDURE_CODE", null]
            },
            then: 1,
            else: 0
          }
        }
      }
    }
  },
  {
    $project: {
      _id: 0,
      payer_name: "$_id",
      num_procedures: 1
    }
  }
]).pretty();

