db.patients.aggregate([    
    {        
        $match: {            
            "CLAIMS.PAYER_REF": ObjectId("c55b16b1-f8c3-f7fb-861c-7ed1e4d24006")        }    
    },    
    {        
        $unwind: "$CLAIMS"    
    },    
    {        
        $unwind: "$CLAIMS.DIAGNOSIS_1"    
    },    
    {        
        $lookup: {            
            from: "payers",            
            localField: "CLAIMS.DIAGNOSIS_1.DESCRIPTION",            
            foreignField: "NAME",            
            as: "matchedPayer"        }    
    },    
    {        
        $project: {            
            _id: 0,             
            CLAIMS: 1        }    
    },    
    {        $unwind: "$CLAIMS"    },    
    {        
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"    
    },    
    {        
        $lookup: {            
            from: "payers",            
            localField: "$CLAIMS.CLAIM_TRANSACTIONS.DESCRIPTION",            
            foreignField: "NAME",            
            as: "matchedPayer"        }    
    },    
    {        
        $project: {            
            _id: 0,             
            CLAIMS: 1        }    
    },    
    {        $unwind: "$CLAIMS"    },    
    {        
        $unwind: "$CLAIMS.IMMUNIZATIONS"    
    },    
    {        
        $project: {            
            _id: 0,             
            IMMUNIZATIONS: 1,            
            payer_name: "$matchedPayer.NAME"        }    
    },    
    {        
        $match: {            
            payer_name: "Blue Cross Blue Shield"        }    
    },    
    {        
        $group: {            
            _id: {                
                patientID: "$PATIENT_ID",                
                immunizationCode: "$IMMUNIZATIONS.CODE"            
            },            
            immunizations: {                
                $addToSet: {                    
                    code: "$IMMUNIZATIONS.CODE",                    
                    description: "$IMMUNIZATIONS.DESCRIPTION"                
                }            
            }        }    
    },    
    {        
        $project: {            
            _id: 0,             
            immunizations: 1,            
            PATIENT_ID: "$_id.patientID"        }    
    }
]);

